        <label class="titulo" >
            <h2>{title}</h2>

        </label>
        <p>
        {overview}

            <label> {release_date}</label>
            <span>{vote_average}</span>

             </p>
    </div>
    <div class="btn-close">x</div>
      </div>

    </div>

  );
};

